# OEIS sequence: A340069

def binwt(n): return bin(n).count('1')
def aupto(n):
  alst, aset = [], set()
  for k in range(n+1):
    ak = 0
    while True:
      while ak in aset: ak += 1
      if binwt(ak)==binwt(k*ak): break
      ak += 1
    alst.append(ak)
    aset.add(ak)
  return alst
print(aupto(72)) # _Michael S. Branicky_, Jan 02 2021

